export default function Product(props) {
  return (
    <div className='justify-center align align-items: center'>
        <img className='justify-center' src={props.logo} alt="" />

        <p className='product-name'>Greyhound Hoodie {props.title}</p>
        <p className='product-price'>$253.5</p>
    </div>
  )
}
